import React, { Component } from "react";
import Player from "./player";

class Players extends Component {
  state = {
    players: [
      { id: 1, name: "Bibs" },
      { id: 2, name: "Vasili" },
      { id: 3, name: "Rami" },
    ],
  };
  render() {
    return (
      <div className="container">
        <div className="row">
          {this.state.players.map((player) => (
            <Player key={player.id} player={player} />
          ))}
        </div>
      </div>
    );
  }
}

export default Players;
